detailFilter.filterExpression:
if(?p_quarter? = 'Current')
then([Presentation].[Fact].[Current Fiscal Quarter] = 'Y')
else([Presentation].[Fact].[Fiscal Quarter] = ?p_quarter?)

if (?p_year? = 'Current')
then ([Presentation].[Fact].[Current Fiscal Year] = 'Y')
else ([Presentation].[Fact].[Fiscal Year] = ?p_year?)

if(?p_YTD? = 'Y')
then([Presentation].[Fact].[Fiscal Quarter] between '1' and [PrevQuarter])
else([Presentation].[Fact].[Fiscal Quarter] in (1, 2, 3, 4))
